import React from 'react';

import Echo from 'laravel-echo';
import socketio from 'socket.io-client';

const echo = new Echo({
  host: 'http://127.0.0.1:6001',
  broadcaster: 'socket.io',
  client: socketio
});

echo
  .channel('chats.1')
  .listen('ChatMessageCreated', ev => console.log(ev.message.text));

function App() {
  return (
    <div className="App">
      <h1>Teste</h1>
    </div>
  );
}

export default App;
